import { LinkContainter } from "react-router-bootstrap";
import { Navbar, Nav, NavDropdown, Container } from "react-bootstrap";

const Header = () => {
	return (
		<header>
			<Navbar
				bg="dark"
				variant="dark"
				expand="lg"
				collapseOnSelect
			></Navbar>
		</header>
	);
};

export default Header;
